import esignSegelOtpActivationMiddleware from "@/middleware/esign-segel-otp-activation.middleware";
import esignSegelOtpSealMiddleware from "@/middleware/esign-segel-otp-seal.middleware";
import { sealPdf } from "@/utils/esign-utils";
import { createRouter } from "next-connect";
const router = createRouter();

router
  .use(esignSegelOtpActivationMiddleware)
  .use(esignSegelOtpSealMiddleware)
  .get(async (req, res) => {
    try {
      const totpSeal = req.totpSeal;
      const hasil = await sealPdf({
        totp: totpSeal,
        file: [
          ``,
        ],
      });

      res.json(hasil?.data);
    } catch (error) {
      console.log(error);
      res
        .status(500)
        .json({
          message: "Something went wrong, please try again later.",
          messageError: error?.response?.data,
        });
    }
  });

export default router.handler({});
